import React from 'react';

function App() {
  return (
    <div style={{ backgroundColor: 'white', color: 'black', padding: '2rem' }}>
      <h1>Прогнозаторът на Вачев</h1>
      <p>Сайтът работи успешно!</p>
    </div>
  );
}

export default App;
